import React from 'react';
import { CompleteButton } from './complete-order.styles';

const CompleteButtonComponent = () => {
  return (
    <CompleteButton disabled>
      COMPLETE ORDER
    </CompleteButton>
  )
}

export default CompleteButtonComponent;
